export default function App() {
  return (
    <div className="App">
      <Step />
      <Counter />
      <Dates />
    </div>
  );
}

function Step() {
  return (
    <>
      <div className="step">
        <button>-</button>
        <p>Step:1</p>
        <button>+</button>
      </div>
    </>
  );
}
function Counter() {
  return (
    <>
      <div className="counter">
        <button>-</button>
        <p>Counter:1</p>
        <button>+</button>
      </div>
    </>
  );
}
function Dates() {
  const currDate = new Date().getTimezoneOffset().toLocaleDateString();
  return (
    <>
      <div className="date">
        <p>2 days from today is {currDate}</p>
      </div>
    </>
  );
}
